function district( pid,cid,aid,nv){this.init( pid,cid,aid,nv);}
district.prototype = {
	init:function(p_id,c_id,a_id,nv){
		var obj = this;
		if( p_id ){
			this.p = document.getElementById( p_id );
			this.p.onchange = function(event){
				obj.pChange( event,obj);
			};
		}
		if( c_id ){
			this.c = document.getElementById( c_id );
			this.c.onchange = function(event){
				obj.cChange( event,obj);
			};
		}
		if( a_id ){
			this.a = document.getElementById( a_id );
		}
		this.nv = nv;
		this.pushto( "1", this.p);
	},
	pChange:function(e,obj){
		e = e||window.event;
		var ele = e.target||e.srcElement;
		v = ele.value;
		obj.pValue = obj.getId( '1' , v );
		obj.pushto( obj.pValue ,obj.c,obj.a);
	},
	cChange:function(e,obj){
		e = e||window.event;
		var ele = e.srcElement||e.target;
		v = ele.value;
		if( !obj.pValue ){
			obj.pValue = obj.getId('1',obj.p.options[obj.p.selectedIndex].value );
		}
		obj.pushto(obj.getId(obj.pValue,v),obj.a);
	},
	pushto:function(v , s ,clear ){
		if(v!=""&&s){
			while(s.length )s.remove( s.length - 1 );
			if(clear){
				while(clear.length )clear.remove( clear.length - 1 );
			}
			s.options.add( new Option("",""));
			args = ht_district[v];
			size = args.length;
			for(i=0;i<size;i++){
				if( this.nv ){
					var op = new Option( args[i].name , args[i].name);
					op.id=args[i].id;
					s.options.add(op);
				}else{
					var op = new Option( args[i].name , args[i].id);
					op.id=args[i].id;
					s.options.add(op);
				}
			}
		}
	},
	load:function(rootId, parentId,type ){
		if( type == 1 ) return;
		var p = this.p;
		for(i=0;i<p.options.length;i++){
			if( p.options[i].value == rootId ){
				p.options[i].selected = true;
			}
		}
		if( type ==3 ){
			this.pushto( rootId,this.c);
			var c = this.c;
			if( c){
				for(i=0;i<c.options.length;i++){
					if( c.options[i].value == parentId ){
						c.options[i].selected = true;
					}
				}	
			}
		}
	},
	getId:function( p , v ){
		var _options = ht_district[p];
		size = _options.length;
		for(i=0;i<size;i++){
			if( _options[i].id == v ||_options[i].name == v ){
				return _options[i].id;
			}
		}
	},
	loadBy:function(args){
		try{
		if( args.p == null || args.p == '' ) return;
		if( (args.c == null || args.c == '' ) && !(args.a == null || args.a == '') ) return;
		var p = this.p;

		for(i=0;i<p.options.length;i++){
			if( p.options[i].value == args.p || p.options[i].innerHTML == args.p ){
				p.options[i].selected = true;
				break;
			}
		}
		this.pushto( this.getId( '1' , args.p ) ,this.c);
		if( args.c != null && args.c != '' ){
			var c = this.c;
			if(c){
				for(i=0;i<c.options.length;i++){
					if( c.options[i].value == args.c || c.options[i].innerHTML == args.c ){
						c.options[i].selected = true;
					}
				}	
			}
		}
		this.pushto( this.getId(this.getId( '1' , args.p ),args.c),this.a);
		if( args.a != null && args.a != '' ){
			var a = this.a;
			if(a){
				for(i=0;i<a.options.length;i++){
					if( a.options[i].value == args.a || a.options[i].innerHTML == args.a){
						a.options[i].selected = true;
					}
				}	
			}
		}
		}catch(e){}
	}
}

